import React from "react";

function CategorySection() {
  const categories = [
    { name: "Medicines", icon: "üíä" },
    { name: "Personal Care", icon: "üß¥" },
    { name: "Health Care", icon: "üè•" },
    { name: "Beauty", icon: "üíÖ" },
    { name: "Health Vlogs", icon: "üé•" },
    { name: "Ayurveda", icon: "üåø" },
  ];

  return (
    <section className="category-section container my-5">
      <h2 className="text-center mb-4">Shop by Category</h2>
      <div className="row g-4 text-center">
        {categories.map((cat, index) => (
          <div key={index} className="col-6 col-md-4 col-lg-2">
            <div className="category-card p-3 shadow-sm rounded">
              <div className="icon fs-1">{cat.icon}</div>
              <h5 className="mt-2">{cat.name}</h5>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default CategorySection;
